import React from "react";

function Popular() {
  return (
    <div className="popular-div">
      <div className="popular-products">
        <div>
          <h3>Creatine</h3>
        </div>
        <div>
          <h3>Whey Protein</h3>
        </div>
        <div>
          <h3>Mass Gainer</h3>
        </div>
      </div>
    </div>
  );
}

export default Popular;
